import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';  // Assuming Navbar is a default export
import Home from './pages/Home';           // Assuming Home is a default export
import Products from './pages/Products';   // Assuming Products is a default export
import About from './pages/About';         // Assuming About is a default export
import Contact from './pages/Contact';     // Assuming Contact is a default export
import ProductDetail from './pages/ProductDetail'; // Assuming ProductDetail is a default export

function App() {
  return (
    <Router>
      <div>
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/products" element={<Products />} />
          <Route path="/product/:id" element={<ProductDetail />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
